import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  const [active, setActive] = useState(null);

  const showMenu = (name) => setActive(name);
  const hideMenu = () => setActive(null);

  return (
    <header>
      {/* TOP STRIP */}
      <div className="topbar">
        <div className="left-links">
          <Link to="/equipment">Equipment</Link>
          <Link to="/news">News</Link>
          <Link to="/careers">Careers</Link>
          <Link to="/contact">Contact</Link>
        </div>

        <div className="right-btns">
          <Link className="orange-btn" to="/driver-application">DRIVER APPLICATION</Link>
          <Link className="orange-btn" to="/loadtrack">LOADTRACK!</Link>
          <Link className="black-btn" to="/login">LOGIN</Link>
        </div>
      </div>

      {/* MAIN NAV */}
      <nav className="main-nav">
        <ul>
          <li onMouseEnter={() => showMenu("drive")} onMouseLeave={hideMenu}>
            <span>DRIVE FOR TMC ▾</span>
            {active === "drive" && (
              <div className="dropdown">
                <Link to="/drive/company">Company Drivers</Link>
                <Link to="/drive/lease">Lease Operators</Link>
                <Link to="/drive/training">Training</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => showMenu("transport")} onMouseLeave={hideMenu}>
            <span>TRANSPORTATION SOLUTIONS ▾</span>
            {active === "transport" && (
              <div className="dropdown">
                <Link to="/transport/flatbed">Flatbed</Link>
                <Link to="/transport/specialized">Specialized</Link>
                <Link to="/transport/oversize">Oversize</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => showMenu("logistics")} onMouseLeave={hideMenu}>
            <span>TMC LOGISTICS ▾</span>
            {active === "logistics" && (
              <div className="dropdown">
                <Link to="/logistics/services">Logistics Services</Link>
                <Link to="/logistics/network">National Network</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => showMenu("carriers")} onMouseLeave={hideMenu}>
            <span>CARRIERS ▾</span>
            {active === "carriers" && (
              <div className="dropdown">
                <Link to="/carriers/partners">Partner Carriers</Link>
                <Link to="/carriers/support">Carrier Support</Link>
              </div>
            )}
          </li>

          <li onMouseEnter={() => showMenu("company")} onMouseLeave={hideMenu}>
            <span>OUR COMPANY ▾</span>
            {active === "company" && (
              <div className="dropdown">
                <Link to="/company/about">About Us</Link>
                <Link to="/company/leadership">Leadership</Link>
                <Link to="/company/culture">Culture</Link>
              </div>
            )}
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
